import React, { useState, useEffect } from "react";
import { useNavigate } from "react-router-dom";
import authService from "../services/authService";
import "./Profile.css";

function Profile({ username, setIsLoggedIn, setUsername }) {
  const navigate = useNavigate();

  // State for user information
  const [email, setEmail] = useState(""); // Automatically retrieved email
  const [firstName, setFirstName] = useState("John");
  const [lastName, setLastName] = useState("Doe");
  const [newPassword, setNewPassword] = useState(""); // For password reset

  // State for loading and messages
  const [loading, setLoading] = useState(false);
  const [statusMessage, setStatusMessage] = useState("");

  // Fetch email from localStorage on component mount
  useEffect(() => {
    const storedEmail = localStorage.getItem("userEmail");
    if (storedEmail) {
      setEmail(storedEmail);
    }
  }, []);

  // Handle Profile Update
  const handleUpdateProfile = (e) => {
    e.preventDefault();
    setLoading(true);
    setStatusMessage("Profile updated successfully!");
    setLoading(false);
  };

  // Handle Password Reset
  const handleResetPassword = (e) => {
    e.preventDefault();
    setLoading(true);
    setStatusMessage("Password reset successfully!");
    setNewPassword("");
    setLoading(false);
  };

  // Handle Logout
  const handleLogout = () => {
    localStorage.removeItem("userEmail");
    setIsLoggedIn(false);
    setUsername("");
    navigate("/login");
  };

  return (
    <div className="profile-page-container">
      {/* Left Section */}
      <div className="profile-left">
        <div className="profile-logo">
          <i className="profile-icon"></i>
        </div>
        <div className="profile-username">
          <p>{username}</p>
          <button className="edit-button">
            <i className="edit-icon"></i>
          </button>
        </div>
      </div>

      {/* Right Section */}
      <div className="profile-right">
        <h1 className="profile-title">User Profile</h1>
        <form onSubmit={handleUpdateProfile} className="profile-form">
          <div className="form-row">
            <div className="form-group">
              <label>First Name</label>
              <input
                type="text"
                value={firstName}
                onChange={(e) => setFirstName(e.target.value)}
                required
              />
            </div>
            <div className="form-group">
              <label>Last Name</label>
              <input
                type="text"
                value={lastName}
                onChange={(e) => setLastName(e.target.value)}
                required
              />
            </div>
          </div>
          <div className="form-group">
            <label>Email</label>
            <input type="email" value={email} disabled />
          </div>
          <div className="form-group">
            <label>Password</label>
            <input
              type="password"
              value={newPassword}
              onChange={(e) => setNewPassword(e.target.value)}
              placeholder="Enter new password"
            />
            <button
              className="reset-password-button"
              onClick={handleResetPassword}
              disabled={loading}
            >
              {loading ? "Resetting..." : "Reset Password"}
            </button>
          </div>
          <div className="button-group">
            <button type="submit" className="update-button" disabled={loading}>
              {loading ? "Updating..." : "Edit Information"}
            </button>
            <button
              type="button"
              className="delete-button"
              onClick={handleLogout}
            >
              Delete Account
            </button>
          </div>
        </form>
        {statusMessage && <p className="status-message">{statusMessage}</p>}
      </div>
    </div>
  );
}

export default Profile;
